  const [val,setVal]=useState(null)
  const changeHandler=(e)=>{
    setVal(e.target.value)
  }

  const clickHandler=()=>{

  }
  return (
    <form className={styles.wrapper}>
        {/* <div>
          <input className={styles.search} placeholder={placeholder}/>
        </div> */}
