          InputProps={{
            ...params.InputProps,
            type:'search',
          }}

          onChange={changeHandler}
          />
         )}
  sx={{ width: 300 }}
/>
        <div>
           <button className={styles.searchButton} type="submit" onClick={clickHandler}>
           <SearchIcon/>
           </button>
        </div>
    </form>
  )
}
